  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Centers for Medicare and Medicaid
  Services has compiled aggregate national benchmark cost and workload metrics using
  data submitted to CMS by the AB MACs and the DME MACs.  The cost data was extracted
  from monthly cost reports entered into the CMS ART system for the first six months
  of Calendar Year 2010.  The workload data was extracted from monthly workload reports
  entered into the CROWD system for the same period.  Separate displays of the AB
  and DME MAC benchmark metrics can be accessed by clicking on the links below.  Individual
  AB and DME MACs participated in this exercise and have confirmed the accuracy of
  their data which was used as the basis for the compilations.</p>n\",\n\t\"license_title\":
